    max-width: 700px;
    background: #FFF;
    border-radius: 4px;
    box-shadow: 0 0 20px rgba(0, 0, 0, 0.1);
    padding: 30px;
    margin: 80px auto;
`;

export const Owner = styled.header`
    display: flex;
    flex-direction: column;
    align-items: center;

    img{
        margin-top: 7px;
        width: 120px;
    }

    p{
        margin-top: 7px;
        font-size: 14px;
        color: #666;
    }
`;
